// AboutMe.js
import React from 'react';

function AboutMe() {
  return (
    <section id="about-me">
      <img src="your-photo.jpg" alt="Your Name" />
      <p>Hello! My name is Nathan!</p>
    </section>
  );
}

export default AboutMe;
